var socket = io();
$("#send").on("click",function(){
 var value = $("#text1").val();
    socket.emit("chat",{
        "content" : value
    })
})

socket.on("chat",function(msg){
    $("#main").prepend("<li><b>" + msg.content + "</b></li>");
});
